function getUrlParam(sUrl, sKey) {
   let _arr = sUrl.match(/(?<=(&|\\?))([\\w-]*=[^&]*)(?=&|$)/g)
       let obj = {}
       for (let i in _arr) {
           let ky = _arr[i].split("=")
           if (obj.hasOwnProperty(ky[0])) {
               if(!Array.isArray(obj[ky[0]])){
                   let _val = obj[ky[0]]
                   obj[ky[0]] = []
                   obj[ky[0]].push(_val)
               }
               obj[ky[0]].push(ky[1])
           }else obj[ky[0]] = ky[1]
       }
   if (sKey == "" || typeof sKey == "undefined") {
       return obj
   }else{
       if(!obj[sKey])return ""
       return obj[sKey]
   }
}
